import React from "react";
import Data from "../example_data.json";

import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Typography from "@mui/material/Typography";
import Avatar from "@mui/material/Avatar";
import FiberManualRecordIcon from "@mui/icons-material/FiberManualRecord";
import {CardActionArea} from "@mui/material";
import {flexbox} from "@mui/system";
import {Box} from "@mui/material";

const commonStyles = {
  bgcolor: "background.paper",
  m: 1,
  border: 5,
  width: "5rem",
  height: "5rem",
};
export const PlaceList = () => {
  const info = Data.map((item) => (
    <Card
      key={item.id}
      sx={{...commonStyles, borderColor: "primary.main", display: "inline"}}>
      <CardHeader
        avatar={
          <Avatar src={item.profile_image_url} variant="rounded"></Avatar>
        }
        action={<FiberManualRecordIcon />}
        title={item.name}
        subheader={`${item.operation_time[0]["time_open"]} - ${item.operation_time[0]["time_close"]}`}
      />
    </Card>
  ));

  return <>{info}</>;
};
